	add("phyllotaxis", "{\"term\":\"phyllotaxis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027φύλλον\u0027 (leaf) + \u0027τάξις\u0027 (arrangement) from \u0027τάσσω\u0027 (arrange)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The arrangement of leaves on a stem, or the mathematical principles governing such arrangement\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, John Fowles, \u0027A Maggot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Yet his Lordship would find this rate of proportion likewise in all plants, in the disposition of their leaves, for which ordering he would make a name, that is, from the Greek, \u0027\u0027\u0027phyllotaxis\", \"priority\":3}]}, \"synonyms\":{}}");

	add("phylloxera", "{\"term\":\"phylloxera\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From the original, superseded genus name \u0027phylloxera\u0027 from Ancient greek (to 1453) \u0027φύλλον\u0027 (lang\u003dgrc) + \u0027ξηρός\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An aphid, of the family Phylloxeridae (not the genus \u0027Phylloxera\u0027), that is very destructive to grape vines; also, the diseased condition of a vine caused by this aphid\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, \u0027A Savage War of Peace\u0027, New York Review Books 2006, p. 32\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"thirty-five years later the coming of \u0027\u0027phylloxera\u0027\u0027 to France launched the Algerian wine industry, and by the mid-twentieth century it had grown to be one of the Mediterranean\u0027s biggest producers\", \"priority\":3}]}, \"synonyms\":{}}");

	add("phylocode", "{\"term\":\"phylocode\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A draft Code of formal nomenclature intended to allow naming phylogenetic groups, of all living things, rather than taxonomic groups (taxa). Officially, such names are intended to supplement scientific names rather than replace them\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027New Scientist,\u0027 11 Sep 2004, p.12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They want to replace it with a more rational scheme they call the \u0027\u0027PhyloCode\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027New Scientist,\u0027 11 Sep 2004, p.13\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Given the hostile reception \u0027\u0027PhyloCode\u0027\u0027 has received so far, they have a lot of convincing to do \u0026amp;mdash\", \"priority\":5}]}, \"synonyms\":{}}");

