	add("phylum", "{\"term\":\"phylum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027phylum\u0027 from Ancient greek (to 1453) \u0027φῦλον\u0027 (tribe, race)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rank in the classification of organisms, below kingdom and above class; also called a division, especially in describing plants; a taxon at that ran\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Mammals belong to the \u0027\u0027phylum\u0027\u0027 Chordata\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A large division of possibly related languages, or a major language family which is not subordinate to another\", \"priority\":3}]}, \"synonyms\":{}}");

