	add("physician", "{\"term\":\"physician\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027fisicien\u0027 () from Old french (842-ca. 1400) \u0027fisicïen\u0027 (physician) from \u0027fisique\u0027 () from Latin \u0027physica\u0027 (natural science) from Ancient greek (to 1453) {{m|grc|φυσική ἐπιστήμη||knowledge of nature}}, from {{m|grc|φυσικός||pertaining to nature}}. Displaced native Middle English \u0027leche\u0027 archaic Modern English \u0027leec. Etymology 2|leech\u0027 \u0026quot;physician\u0026quot; (from Old English {{m|ang|lǣċe||physician, medical doctor}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A practitioner of physic, i.e. a specialist in internal medicine, especially as opposed to a surgeon; a practitioner who treats with medication rather than with surgery\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"His forefathers had been, as a rule, professional men\u0026amp;mdash;\u0027\u0027physicians\u0027\u0027 and lawyers; his grandfather died under the walls of Chapultepec Castle while twisting a tourniquet for a cursing dragoon; an uncle remained indefinitely at Malvern Hill\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A medical doctor trained in human medicine\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The doctor had to go to London for a \u0027\u0027physician\u0027\u0027 to take charge of his practice\", \"priority\":4}]}, \"synonyms\":{}}");

