	add("physics", "{\"term\":\"physics\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027φυσικός\u0027 (natural)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The branch of science concerned with the study of properties and interactions of space, time, matter and energy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003dA Palette of volume\u003d100|issue\u003d2|page\u003d146|magazine\u003d|url\u003dhttp://www.americanscientist.org/issues/feature/2012/2/a-palette-of-particles|passage\u003dThe \u0027\u0027physics\u0027\u0027 of elementary particles in the 20th century was distinguished by the observation of particles whose existence had been predicted by theorists sometimes decades earlier\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Newtonian \u0027\u0027physics\u0027\u0027 was extended by Einstein to explain the effects of travelling near the speed of light; quantum \u0027\u0027physics\u0027\u0027 extends it to account for the behaviour of atoms\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Of or pertaining to the physical aspects of a phenomenon or a system, especially those studied in physics\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027physics\u0027\u0027 of car crashes would not let Tom Cruise walk away like that\", \"priority\":5}]}, \"synonyms\":{}}");

