	add("physiognomy", "{\"term\":\"physiognomy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027\u0027 Middle french (ca. 1400-1600) \u0027\u0027 et al., and their source, \u0027\u0027 from Ancient greek (to 1453) \u0027φυσιογνωμονία\u0027 (the science or art of judging a man by his features) from \u0027φύσις\u0027 (physique, appearance) + \u0027γνώμων\u0027 (one that knows or examines, an interpreter, discerner)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The art or pseudoscience of deducing the predominant temper and other characteristic qualities of the mind from the outward appearance, especially from the features of the face\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The face or countenance, with respect to the temper of the mind; particular configuration, cast, or expression of countenance, as denoting character\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The art of telling fortunes by inspection of the features\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The general appearance or aspect of a thing, without reference to its scientific characteristics; as, the physiognomy of a plant, or of a meteor\", \"priority\":4}]}, \"synonyms\":{}}");

