	add("physiography", "{\"term\":\"physiography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|physio|graphy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The subfield of geography that studies physical patterns and processes of the Earth. It aims to understand the forces that produce and change rocks, oceans, weather, and global flora and fauna patterns\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The descriptive part of a natural science as distinguished from the explanatory or theoretical part\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"mineral \u0027\u0027physiography\", \"priority\":3}]}, \"synonyms\":{}}");

	add("physiology", "{\"term\":\"physiology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From French \u0027lang\u003dfr\u0027 from Latin \u0027lang\u003dla\u0027 from Ancient greek (to 1453) \u0027φυσιολογία\u0027 (natural philosophy) from \u0027φύσις\u0027 (nature) + \u0027λόγος\u0027 (word)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A branch of biology that deals with the functions and activities of life or of living matter (as organs, tissues, or cells) and of the physical and chemical phenomena involved\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The study and description of natural objects; natural science\", \"priority\":2}]}, \"synonyms\":{}}");

