	add("phytoequivalence", "{\"term\":\"phytoequivalence\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"{{prefix|phyto|equivalence|lang\u003den}}. Calque of the German \u0027lang\u003dde\u0027 a term of the same meaning which was introduced by the German Commission E, an expert commission on herbal medicine, in the 1980s.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A physiological equivalence between the effects of two herbal extracts, the efficacy of one of which has been clinically demonstrated\", \"priority\":1}]}, \"synonyms\":{}}");

	add("phytoestrogen", "{\"term\":\"phytoestrogen\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|phyto|estrogen|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a range of various compounds found in plants that function similarly to estrogens\", \"priority\":1}]}, \"synonyms\":{}}");

	add("phytogeography", "{\"term\":\"phytogeography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|phyto|geography|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The science that studies the geographical distribution of plants; geobotany\", \"priority\":1}]}, \"synonyms\":{}}");

	add("phytolatry", "{\"term\":\"phytolatry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|phyto|latry|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The worship of plants\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Euclides da Cunha, \u0027Rebellion in the Backlands\u0027 (page 132\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An impressive chapel to this day commemorates his stay there; but more venerated than this, perhaps, is the little tree at the entrance to the town which was for a long time the object of an extraordinary \u0027\u0027phytolatry\", \"priority\":3}]}, \"synonyms\":{}}");

