	add("phytomelan", "{\"term\":\"phytomelan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A black, inert, carbonaceous material that lacks nitrogen, probably derived from catechol, that forms a crust-like covering on some seeds\", \"priority\":1}]}, \"synonyms\":{}}");

	add("phytomining", "{\"term\":\"phytomining\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|phyto|mining|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The planting (and subsequent harvesting) of vegetation that selectively concentrate specific metals from the environment into their tissues, for the primary or subsidiary purpose of commercial exploitation of the extracted metal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, J. Scott Angle, Nicholas A. Linacre, \u0027Ecological Risks of Novel Environmental Crop Technologies Using Phytoremediation as an Example\u0027, [http://books.google.com.au/books?id\u003drQO75ucv4fUC\u0026amp;pg\u003dPA14\u0026amp;dq\u003d%22phytomining%22%7C%22phytominings%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dwWVzU9TSFIXwkAXpnoDABQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22phytomining%22%7C%22phytominings%22\u0026amp;f\u003dfalse page 14\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Cultivation of hyperaccumulators on naturally enriched areas offers the greatest promise for use in \u0027\u0027phytomining\u0027\u0027. \u0027\u0027Phytomining\u0027\u0027 is a more specific form of phytoremediation where the purpose of metal removal from soil is economic gain\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Christopher W. N. Anderson, \u0027Chapter 5: Hyperaccumulation by Plants\u0027, Andrew Hunt, George A. Kraus, James H. Clark (editors), \u0027Element Recovery and Sustainability\u0027, [http://books.google.com.au/books?id\u003dQmbfLX4TgGEC\u0026amp;pg\u003dPA121\u0026amp;dq\u003d%22phytomining%22%7C%22phytominings%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dwWVzU9TSFIXwkAXpnoDABQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22phytomining%22%7C%22phytominings%22\u0026amp;f\u003dfalse page 121\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The three metals, nickel, thallium and gold were reported as candidates for \u0027\u0027phytomining\u0027\u0027 in 1999 owing to the relatively high price that each metal commands on international commodity markets\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Meri Barbafieri, Jan Japenga, Paul Romkens, Giannantonio Petruzzelli, Francesca Pedron, \u00272: Protocols for Applying Phytotechnologies in Metal-Contaminated Soils\u0027, Dharmendra Kumar Gupta (editor), \u0027Plant-Based Remediation Processes\u0027, [http://books.google.com.au/books?id\u003d3WhHAAAAQBAJ\u0026amp;pg\u003dPA23\u0026amp;dq\u003d%22phytomining%22%7C%22phytominings%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dwWVzU9TSFIXwkAXpnoDABQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22phytomining%22%7C%22phytominings%22\u0026amp;f\u003dfalse page 23\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"This would be possible in the case of \u0027\u0027phytomining\u0027\u0027, a particular example of phytoextraction. \u0027\u0027Phytomining\u0027\u0027 involves the exploitation of subeconomic ore bodies using hyperaccumulating plants\", \"priority\":10}]}, \"synonyms\":{}}");

